#!/usr/bin/env python3
import base64
import zlib
import sys

ENCRYPTED_DATA = """"""

KEY = b"juned"

def xor_decrypt(data, key):
    result = bytearray()
    for i in range(len(data)):
        result.append(data[i] ^ key[i % len(key)])
    return bytes(result)

try:
    encrypted_bytes = base64.b64decode(ENCRYPTED_DATA)
    compressed_data = xor_decrypt(encrypted_bytes, KEY)
    original_code = zlib.decompress(compressed_data)
    exec(original_code.decode("utf-8"))
except Exception as e:
    print(f"Error decrypting/executing: {e}")
    sys.exit(1)
